import React from "react";
import "./libcont.css";
import "./weather.css";
import lamp from "https://s3-us-west-2.amazonaws.com/s.cdpn.io/279756/lamp.png"

function weather() {
  return (
    <>
      <div className="foodcontainer">

        <iframe
          src={"/weather/index.html"}
          name="iframe-music"
          style={{ top:'200pt', width: '100%', border: '0px', height: '100%' }}
        />

        <div class="wrapper">
          <div class="card">
            <div class="card__image">
              <img src={lamp}/>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}


export default weather;
